// 공통적인 것을 처리하기위한 곳
import React from 'react'
import PropTypes from "prop-types";
import 'antd/dist/antd.css';

const App = ({Component}) => {
    return (
        <Component />
    )
}

App.propTypes = {
    Component: PropTypes.elementType.isRequired,
}

export default App
